    render() {
        return (
            <div>
                <Button node="button">Drop Me!</Button>
            <Dropdown
            id="Dropdown_6"
            options={{
              alignment: 'left',
              autoTrigger: true,
              closeOnClick: true,
              constrainWidth: true,
              container: null,
              coverTrigger: true,
              hover: false,
              inDuration: 150,
              onCloseEnd: null,
              onCloseStart: null,
              onOpenEnd: null,
              onOpenStart: null,
              outDuration: 250
            }}
            trigger={<Button node="button">Drop Me!</Button>}
          >
            <a href="#">
              one
            </a>
            <a href="#">
              two
            </a>
            <a href="#">
              three
            </a>
          </Dropdown>
          </div>
        );
    }

}

export default GPDHomeScreen;
